function Formulario(){
    return(
        <form>
            <input type='text' placeholder='nome' className="form-control"></input>
            <input type='text' placeholder='marca' className="form-control"></input>

            <input type='button' value='Cadastrar'></input>
            <input type='button' value='Alterar'></input>
            <input type='button' value='Remover'></input>
            <input type='button' value='Cancelar'></input>
        </form>
    )
}

export default Formulario;
